import {RequestTool} from '../Tools/RequestTool';

const GetCurrentCourse= () =>
    RequestTool.GetRequest("https://localhost:6001/api/education");

const Add= (_item) => RequestTool.PostRequest("https://localhost:6001/api/Education/Add",_item);

export const EducationService= {GetCurrentCourse,Add}
